import { YOUTUBEURL, apiKey } from './apis';

export async function getMovieList(movieId) {
  console.log(movieId);
  return await fetch(`
        ${YOUTUBEURL}videos?key=${apiKey}&id=${movieId}&maxResults=15&part=snippet
    `).then((res) => res.json());
}
